INSERT INTO `categories` (`categoryid`,`name`,`timeinminutes`,`parent`,`description`,`workflow`) VALUES 
 (1,'Papikostik',0,0,'',0),
 (2,'TIKI',0,0,'',0),
 (3,'Berhitung Angka',60,2,'<p>Test berikut ini terdiri atas soal-soal berhitung. Setiap soal disertai dengan empat kemungkinan jawaban a, b, c , dan d. Salah satu di antaranya adalah jawaban yang benar dari soal tersebut. Cara menjawabnya adalah dengan melingkari pada lembar jawaban di belakang nomor soal yang bersangkutan, huruf yang sesuai dengan jawaban tersebut. Perhatikan sekarang contoh di bawah ini.</p>\r\n\r\n<p>Contoh :</p>\r\n\r\n<ol>\r\n	<li>18 + 7 = &hellip;<br />\r\n	a. 25 &nbsp; &nbsp; b. 26 &nbsp; &nbsp; c. 24 &nbsp; &nbsp; d.23</li>\r\n	<li>&hellip; - 1/8 = 1/8<br />\r\n	a.2/4 &nbsp; &nbsp;b.3/8 &nbsp; &nbsp; c.1/4 &nbsp; &nbsp; d.4/8</li>\r\n</ol>\r\n\r\n<p>Pada contoh 1 dapat dilihat bahwa 18 + 7 = 25. Di belakang contoh 1 dapat dilihat bahwa angka 25 terdapat di bawah huruf a. Oleh karena itu, yang harus dilingkari adalah pilihan jawaban a. Jawaban yang benar dari contoh 2 adalah 1/4. Oleh karena itu, yang dilingkari adalah pilihan jawaban c.</p>\r\n\r\n<p>Coba pecahkan sendiri contoh-contoh di bawah ini&hellip; Contoh :</p>\r\n\r\n<ol>\r\n	<li>54 : &hellip; = 6<br />\r\n	a.8 &nbsp; &nbsp;b.6 &nbsp; &nbsp;c.7 &nbsp; &nbsp;d.9</li>\r\n	<li>0,07 + &hellip; = 0,67<br />\r\n	a.0,06 &nbsp; &nbsp;b.0,6 &nbsp; &nbsp; c.0,63 &nbsp; &nbsp; d.0,063</li>\r\n	<li>36/18 : 12/6 = &hellip;<br />\r\n	a.3/6 &nbsp; &nbsp; b.4/6 &nbsp; &nbsp; c.3/3 &nbsp; &nbsp; d.12/18</li>\r\n</ol>\r\n\r\n<p>Jika perlu perhitung-hitungan dapat dilakukan pada kertas kosong yang telah tersedia.</p>\r\n\r\n<p>&nbsp;</p>\r\n',4),
 (4,'Gabungan Bagian',7,2,'<p>Test berikut ini terdiri dari gambar bentuk-bentuk.</p>\r\n\r\n<p>Gambar di sebelah kiri dari setiap soal merupakan bentuk yang terpotong menjadi 3 bagian yang sudah ditentukan. &nbsp;Di sebelah kanannya terdapat 6 gambar a, b, c, d, e dan f. Dua di antaranya terbuat dari bagian-bagian yang terdapat di sebelah kiri. Carilah kedua gambar tersebut. Apabila sudah ditemukan, lingkarilah <em>pada lembar jawaban</em> di belakang nomor soal yang bersangkutan, huruf-huruf yang menunjukkan gambar yang dimaksudkan.</p>\r\n\r\n<p>Perhatikan sekarang contoh di bawah ini.</p>\r\n\r\n<p><em>Contoh :</em></p>\r\n\r\n<p><em><img alt=\"\" src=\"/TestOnline/upload/TIKI/02/Example 1.png\" style=\"height:128px; width:533px\" /></em></p>\r\n\r\n<p>Pada contoh 1 dapat dilihat bahwa jika bagian-bagian yang terdapat di sebelah kiri digabungkan, maka akan diperoleh gambar-gambar b dan d.&nbsp;<span style=\"line-height:1.6\">Jika bagian-bagian yang terdapat di sebelah kiri dari contoh 2 digabungkan, maka akan diperoleh gambar c dan f.</span></p>\r\n\r\n<p>Di bawah masih terdapat dua contoh lagi. Kerjakan menurut cara yang sama.</p>\r\n\r\n<p><em style=\"line-height:1.6\">Contoh :</em></p>\r\n\r\n<p><img alt=\"\" src=\"/TestOnline/upload/TIKI/02/Example 2.png\" style=\"height:126px; width:564px\" /></p>\r\n',5),
 (5,'Hubungan Kata',5,2,'<p>Test ini terdiri dari kata-kata.</p>\r\n\r\n<p>Setiap soal terdiri dari 4 kata a, b, c, dan d.</p>\r\n\r\n<p>Carilah 2 buah kata yang memiliki kesamaan arti yang paling dekat atau yang mempunyai arti yang berlawanan. Setelah kata-kata itu ditemukan, lingkarilah pada lembar jawaban di belakang nomor soal yang bersangkutan, huruf-huruf yang sesuai.</p>\r\n\r\n<p>Perhatikan contoh di bawah ini.</p>\r\n\r\n<p><em>Contoh :</em></p>\r\n\r\n<ol>\r\n	<li>a.&nbsp;&nbsp; menikah&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; b.&nbsp;&nbsp; menebang&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; c.&nbsp;&nbsp; kawin&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; d.&nbsp;&nbsp; meneduh</li>\r\n</ol>\r\n\r\n<p>Pada contoh 1 dapat dilihat, bahwa kata-kata menikah dan kawin memiliki kesamaan arti. Jadi, jawaban contoh 1 adalah a dan c.</p>\r\n\r\n<p><em>Contoh :</em></p>\r\n\r\n<ol>\r\n	<li>a.&nbsp;&nbsp;&nbsp;&nbsp; selesai&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; b.&nbsp;&nbsp;&nbsp;&nbsp; tua&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; c.&nbsp;&nbsp;&nbsp;&nbsp; usia&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; d.&nbsp;&nbsp;&nbsp;&nbsp; muda</li>\r\n</ol>\r\n\r\n<p><span style=\"line-height:1.6\">Pada contoh 2, kata-kata tua dan muda mempunyai arti yang berlawanan satu sama lain. Oleh karena itu, jawaban dari contoh 2 adalah b dan d.</span></p>\r\n\r\n<p>Di bawah ini masih ada beberapa contoh untuk latihan.</p>\r\n\r\n<p>Kerjakan menurut cara yang sama.</p>\r\n\r\n<p><em>Contoh :</em></p>\r\n\r\n<ol>\r\n	<li>a.&nbsp;&nbsp;&nbsp;&nbsp; lembut&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; b.&nbsp;&nbsp;&nbsp;&nbsp; betul&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; c.&nbsp;&nbsp;&nbsp;&nbsp; salah&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; d.&nbsp;&nbsp;&nbsp;&nbsp; sama</li>\r\n	<li>a.&nbsp;&nbsp;&nbsp;&nbsp; membuka&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; b.&nbsp;&nbsp;&nbsp;&nbsp; menyongsong&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; c.&nbsp;&nbsp;&nbsp;&nbsp; menoleh&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; d.&nbsp;&nbsp;&nbsp;&nbsp; menutup</li>\r\n	<li>a.&nbsp;&nbsp;&nbsp;&nbsp; jenaka&nbsp;&nbsp; b.&nbsp;&nbsp;&nbsp;&nbsp; kecil&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; c.&nbsp;&nbsp;&nbsp;&nbsp; canggung&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; d.&nbsp;&nbsp;&nbsp;&nbsp; lucu</li>\r\n</ol>\r\n',6),
 (6,'Abstraksi non Verbal',12,2,'<p>Dalam test ini setiap soal terdiri dari 10 gambar.<br />\r\nEmpat gambar pertama dari setiap soal menunjukkan kesamaan dalam suatu hal atau segi tertentu. Dua di antara enam gambar a, b, c, d, e, dan f berikutnya menunjukkan kesamaan dengan keempat gambar pertama itu. Carilah kedua gambar yang dimaksudkan itu. Apabila kedua gambar itu sudah ditemukan, lingkarilah pada lembar jawaban di belakang nomor soal yang bersangkutan, huruf-huruf yang menunjukkan gambar tersebut.<br />\r\nPerhatikan contoh-contoh di bawah ini.</p>\r\n\r\n<p>Contoh :</p>\r\n\r\n<p>1.&nbsp;<img alt=\"\" src=\"/TestOnline/upload/TIKI/04/00A.jpg\" style=\"height:50px; width:427px\" /></p>\r\n\r\n<p>2.&nbsp;<img alt=\"\" src=\"/TestOnline/upload/TIKI/04/00B.jpg\" style=\"height:52px; width:430px\" /></p>\r\n\r\n<p>Pada contoh 1 dapat dilihat, bahwa 4 gambar yang pertama semuanya adalah segiempat atau bujur sangkar. Dari 6 gambar berikutnya, hanya gambar a dan f saja yang menunjukkan kesamaan yaitu berupa segiempat atau bujur sangkar. Oleh karena itu, jawaban yang benar adalah a dan f.<br />\r\nPerhatikan sekarang contoh 2. Keempat gambar pertama semuanya dihitamkan dengan cara yang sama. Di antara 6 gambar berikutnya, hanya gambar c dan e yang dihitamkan dengan cara yang sama. Oleh karena itu, jawaban yang benar adalah c dan e.<br />\r\nDi bawah ini terdapat 3 contoh sebagai latihan. Kerjakan menurut cara yang sama.</p>\r\n\r\n<p><img alt=\"\" src=\"/TestOnline/upload/TIKI/04/00C.jpg\" style=\"height:144px; width:440px\" /></p>\r\n',7),
 (7,'Deret Angka',10,2,'<p>Tes berikut ini terdiri dari soal-soal deret angka.</p>\r\n\r\n<p>Setiap soal terdiri dari deret angka-angka yang tersusun menurut suatu aturan atau prinsip tertentu. Dengan demikian berarti bahwa deret itu dapat dilanjutkan menurut aturan atau prinsip tersebut. Carilah dari setiap soal, angka berikutnya sesudah angka terakhir dari soal tersebut. Setiap soal disertai dengan lima kemungkinan jawaban a, b, c, d dan e. Salah satu dari padanya adalah jawaban yang benar dari soal tersebut.</p>\r\n\r\n<p>Cara untuk menemukan angka yang dimaksud ialah dengan mencari terlebih dahulu aturan atau prinsip yang mendasari penyusunan deret tersebut.</p>\r\n\r\n<p>Apabila jawaban sudah ditemukan, lingkarilah <em>pada lembar jawaban</em>, huruf yang menunjukkan angka tersebut.</p>\r\n\r\n<p>Perhatikan contoh-contoh di bawah ini.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Contoh :&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>a&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; b&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; c&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; d&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; e</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li>1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 6&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 10&nbsp;&nbsp;&nbsp;&nbsp; 15&nbsp;&nbsp;&nbsp;&nbsp; 21&nbsp;&nbsp;&nbsp;&nbsp; &hellip;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 26&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 27&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 28&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 29&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 30</li>\r\n	<li>3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 6&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 12&nbsp;&nbsp;&nbsp;&nbsp; 24&nbsp;&nbsp;&nbsp;&nbsp; 48&nbsp;&nbsp;&nbsp;&nbsp; &hellip;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 62&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 96&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 84&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 76&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 72</li>\r\n</ol>\r\n\r\n<p>Prinsip atau aturan yang dipakai untuk menyusun deret dalam contoh 1 adalah bahwa perbedaan dua angka berturut-turut selalu meningkat dan bertambah dengan 1. Dengan demikian, jawaban yang benar dari contoh 1 adalah 28. Oleh karena itu, jawaban yang benar adalah c.</p>\r\n\r\n<p>Pada contoh 2, prinsip yang mendasari penyusunan deret itu adalah bahwa setiap angka adalah kelipatan dua dari angka yang mendahuluinya. Jadi jawabannya adalah 96. Oleh karena itu, jawaban yang dilingkari adalah b.</p>\r\n\r\n<p><span style=\"line-height:1.6\">Contoh :&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><strong style=\"line-height:1.6\">a&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; b&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; c&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; d&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; e</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li>3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 7&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 4&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 7&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 5&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &hellip;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 7&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 8&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 6&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 4&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 5</li>\r\n	<li>1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 4&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 5&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 10&nbsp;&nbsp;&nbsp;&nbsp; 20&nbsp;&nbsp;&nbsp;&nbsp; 40&nbsp;&nbsp;&nbsp;&nbsp; &hellip;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 50&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 60&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 75&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 80&nbsp;&nbsp;&nbsp;&nbsp; 65</li>\r\n</ol>\r\n',8),
 (8,'Meneliti',4,2,'<p>Test berikut ini terdiri dari rangkaian angka-angka atau huruf-huruf.</p>\r\n\r\n<p>Pertama-tama akan dijumpai bahwa setiap soal terdiri dari dua rangkaian angka yang dipisahkan satu sama lain oleh suatu garis. Selanjutnya soal-soal akan terdiri dari rangkaian huruf-huruf.</p>\r\n\r\n<p>Untuk kedua bentuk soal, akan sering dijumpai bahwa rangkaian yang terdapat di depan garis pemisah sama dengan yang ada di belakangnya. Tetapi kadang-kadang berbeda.</p>\r\n\r\n<p>Coba diteliti apakah rangkaian yang terdapat di depan dan di belakang garis pemisah itu sama ataukah berbeda. Apabila <em>sama</em>, pilihlah pada <em>lembar jawaban</em>, huruf<em> <strong>s</strong>. </em>Apabila berbeda atau <em>tidak sama</em>, pilhlah pada lembar jawaban, huruf <strong><em>ts</em></strong>. Perhatikan contoh di bawah ini.</p>\r\n\r\n<p>Contoh :</p>\r\n\r\n<ol>\r\n	<li>216770&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 216770</li>\r\n	<li>848217&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 845217</li>\r\n	<li>ZRWRF&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ZRWFR</li>\r\n	<li>BPADL&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; BPADL</li>\r\n</ol>\r\n\r\n<p>Pada contoh 1, dapat dilihat bahwa kedua rangkaian angka itu sama. Oleh karena itu, huruf <em>s</em> yang harus dipilih.</p>\r\n\r\n<p>Pada contoh 2, kedua rangkaian angka itu tidak sama. Oleh karena itu, huruf <em>ts</em> harus dipilih pada <em>lembar jawaban</em>.</p>\r\n\r\n<p>Pada contoh 3, kedua rangkaian huruf itu berbeda. Oleh karena itu, huruf <em>ts</em> dipilih.</p>\r\n\r\n<p>Sedangkan pada contoh ke 4, kedua rangkaian huruf itu sama. Karenanya huruf <em>s </em>dipilih.</p>\r\n\r\n<p>Di bawah ini terdapat beberapa contoh sebagai latihan. Kerjakan sesuai dengan cara yang diuraikan di atas.</p>\r\n\r\n<p>Contoh :</p>\r\n\r\n<ol>\r\n	<li>736251&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 736251</li>\r\n	<li>78491&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 74891</li>\r\n	<li>RBVHH&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; RVBHH</li>\r\n	<li>XTRFG&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; XTFRG</li>\r\n</ol>\r\n',10),
 (9,'MBTI',15,0,'',0),
 (10,'WPT-A',12,0,'<p>Tes ini berisi 50 pertanyaan yang secara bertahap menjadi semakin sulit. Anda tidak mungkin dapat menyelesaikan semua pertanyaan, tetapi selesaikan semampu Anda.</p>\r\n\r\n<p>Setelah petugas tes meminta Anda untuk mulai, Anda memiliki waktu 12 menit untuk memberi jawaban yang benar sebanyak mungkin. Kerjakan dengan teliti, namun jangan menghabiskan waktu lama pada setiap pertanyaan atau lewati pertanyaan itu. Pastikan Anda menulis jawaban pada tanda kurung yang tersedia. Sebelum Anda memulai tes ini, jawablah Contoh Pertanyaan dibawah ini.&nbsp;</p>\r\n\r\n<p>Perhatikan satu contoh pertanyaan yang terisi dengan benar:</p>\r\n\r\n<p>MENUAI adalah lawan kata dari</p>\r\n\r\n<ul>\r\n	<li>mendapat&nbsp;&nbsp;&nbsp; 2.&nbsp; bersorak&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3. melanjutkan&nbsp;&nbsp;&nbsp;&nbsp; 4. berada&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 5. menabur &hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;.</li>\r\n</ul>\r\n\r\n<p><em>Jawaban yang benar adalah &ldquo;menabur&rdquo;.&nbsp;</em></p>\r\n\r\n<p><strong>Jawablah contoh pertanyaan berikut ini.</strong></p>\r\n\r\n<ul>\r\n	<li>Harga setiap kotak &lsquo;paper clip&rsquo; adalah 23 rupiah. Berapa harga 4 kotak?&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;. &nbsp; &nbsp;</li>\r\n</ul>\r\n\r\n<p><em>Jawabannya adalah Rp. 92. Tulislah angka &rsquo;92&rsquo; dalam tanda kurung di sebelah kanan.</em></p>\r\n\r\n<ul>\r\n	<li>MINER&nbsp;&nbsp;&nbsp;&nbsp; MINOR&nbsp;&nbsp; -&nbsp; Apakah kata-kata ini</li>\r\n</ul>\r\n\r\n<p>1. memiliki arti sama&nbsp;&nbsp; 2. memiliki arti berlawanan&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3. tidak memiliki arti sama atau berlawanan</p>\r\n\r\n<p>Jawaban yang benar adalah &lsquo;tidak memiliki arti sama atau berlawanan (Nomor 3).&nbsp;</p>\r\n',11),
