 (41,10,'<p>Bulan lalu pada awal tahun ini adalah&nbsp;(masukan angka pilihan anda)</p>\r\n\r\n<p>1.Januari</p>\r\n\r\n<p>2. Maret</p>\r\n\r\n<p>3. Juli</p>\r\n\r\n<p>4. Desember</p>\r\n\r\n<p>5. Oktober</p>\r\n',0,1,0),
 (42,10,'<p>MENANGKAP adalah lawan kata dari (masukan angka pilihan anda)</p>\r\n\r\n<p>1. meletakkan</p>\r\n\r\n<p>2. membebaskan</p>\r\n\r\n<p>3. beresiko</p>\r\n\r\n<p>4. berusaha</p>\r\n\r\n<p>5. turun tingkat</p>\r\n',0,1,0),
 (43,10,'<p>Sebagian besar hal dibawah ini serupa satu sama lain. Manakah salah satu diantaranya yang kurang serupa dengan yang lain? (masukan angka pilihan anda)&nbsp;</p>\r\n\r\n<p>1. Januari</p>\r\n\r\n<p>2. Agustus</p>\r\n\r\n<p>3. Rabu</p>\r\n\r\n<p>4. Oktober</p>\r\n\r\n<p>5. Desember</p>\r\n',0,1,0),
 (44,10,'<p>Jawablah dengan menuliskan &quot;Ya&quot; atau &quot;Tidak&quot;. Apakah RSVP berarti &quot;jawablah yang tidak perlu&quot; ?</p>\r\n',0,1,0),
 (45,10,'<p>Dalam kelompok kata berikut, manakah kata yang berbeda dari kata yang lain? (masukan angka pilihan anda)&nbsp;</p>\r\n\r\n<p>1. pasukan</p>\r\n\r\n<p>2. liga</p>\r\n\r\n<p>3. berpartisipasi</p>\r\n\r\n<p>4. pak</p>\r\n\r\n<p>5. kelompok</p>\r\n',0,1,0),
 (46,10,'<p>BIASA adalah lawan kata dari (masukan angka pilihan anda)</p>\r\n\r\n<p>1. jarang</p>\r\n\r\n<p>2. terbiasa</p>\r\n\r\n<p>3. tetap</p>\r\n\r\n<p>4. berhenti</p>\r\n\r\n<p>5. selalu</p>\r\n',0,1,0),
 (47,10,'<p>Gambar manakah yang terbuat dari dua gambar di dalam tanda kurung?&nbsp;(masukan angka pilihan anda)</p>\r\n\r\n<p><img alt=\"\" src=\"/TestOnline/upload/WPT/07.JPG\" style=\"height:91px; width:137px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"/TestOnline/upload/WPT/07.1.JPG\" style=\"height:64px; width:97px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"/TestOnline/upload/WPT/07.2.JPG\" style=\"height:78px; width:81px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"/TestOnline/upload/WPT/07.3.JPG\" style=\"height:84px; width:94px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"/TestOnline/upload/WPT/07.4.JPG\" style=\"height:78px; width:148px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"/TestOnline/upload/WPT/07.5.JPG\" style=\"height:93px; width:113px\" /></p>\r\n',0,1,0),
 (48,10,'<p>Perhatikan urutan angka berikut. Angka berapa yang selanjutnya muncul?</p>\r\n\r\n<p>8, 4, 2, 1, 1/2, 1/4, ... ?</p>\r\n\r\n<p>(Jawab dalam bentuk misal 1/15 atau 1/9)</p>\r\n',0,1,0),
 (49,10,'<p>Klien dan Pelanggan. Apakah kata-kata ini: (Pilih nomor jawaban anda)</p>\r\n\r\n<p>1. memiliki arti yang sama</p>\r\n\r\n<p>2. memiliki arti berlawanan</p>\r\n\r\n<p>3. tidak memiliki arti sama atau berlainan?</p>\r\n',0,1,0),
 (50,10,'<p>Manakah kata berikut ini yang berhubungan dengan aroma saat gigi mengunyah?</p>\r\n\r\n<p>1. manis</p>\r\n\r\n<p>2. bau tak sedap</p>\r\n\r\n<p>3. bau wangi</p>\r\n\r\n<p>4. hidung</p>\r\n\r\n<p>5. bersih</p>\r\n',0,1,0),
 (51,10,'<p>MUSIM GUGUR adalah lawan dari:</p>\r\n\r\n<p>1. liburan</p>\r\n\r\n<p>2. musim panas</p>\r\n\r\n<p>3. musim semi</p>\r\n\r\n<p>4. musim dingin</p>\r\n\r\n<p>5. musim gugur</p>\r\n',0,1,0),
 (52,10,'<p>Sebuah pesawat terbang 300 kaki dalam &frac12; detik. Pada kecepatan yang sama berapa kaki ia terbang dalam 10 detik?</p>\r\n\r\n<p>(isi jawaban dalam bentuk desimal atau pecahan misal 200, 800, 90.5)&nbsp;</p>\r\n',0,1,0),
 (53,10,'<p>Anggaplah dua pernyataan pertama adalah Benar atau Salah atau Tidak Tahu. Apakah yang terakhir:&nbsp;</p>\r\n\r\n<p><span style=\"line-height:1.6\">&quot;Anak-anak lelaki ini adalah anak yang normal. Semua anak normal sifatnya aktif. Anak-anak lelaki ini aktif&quot;</span></p>\r\n',1,0,0),
 (54,10,'<p>JAUH adalah lawan kata dari</p>\r\n\r\n<p>1. terpencil</p>\r\n\r\n<p>2. dekat</p>\r\n\r\n<p>3. jauh</p>\r\n\r\n<p>4. terburu-buru</p>\r\n\r\n<p>5. pasti</p>\r\n',0,1,0),
 (55,10,'<p>3 permen lemon seharga 10 rupiah. Berapa harga 1/2 lusin?</p>\r\n\r\n<p>(jawab dalam bentuk desimal misal 12, 200, atau 90.5)</p>\r\n',0,1,0),
 (56,10,'<p>Berapa banyak duplikasi yang sama dari lima pasangan angka dibawah ini?</p>\r\n\r\n<ul>\r\n	<li>84721 - 84721</li>\r\n	<li>9210651 - 9210561</li>\r\n	<li>14201201 - 14210210</li>\r\n	<li>96101101 - 96101161</li>\r\n	<li>88884444 - 88884444&nbsp;</li>\r\n</ul>\r\n',0,1,0),
 (57,10,'<p>Susun kata-kata berikut sehingga menjadi pernyataan yang benar. Tuliskan huruf terakhir dari kata terakhir sebagai jawaban.</p>\r\n\r\n<p>Selalu - sebuah - kata kerja - kalimat - suatu - memiliki</p>\r\n',0,1,0),
 (58,10,'Anak lelaki berumur 5 tahun dan saudara perempuannya dua kali lebih tua. Ketika anak lelaki itu berumur 8 tahun,\r\nberapa umur saudara perempuannya?  \r\n',0,1,0),
 (59,10,'<p>IT&#39;S - ITS. Apakah kata ini?</p>\r\n\r\n<p>1. memiliki arti yang sama</p>\r\n\r\n<p>2. memiliki arti yang berlawanan</p>\r\n\r\n<p>3. tidak memiliki arti yang sama atau berlawanan</p>\r\n\r\n<p>(Pilih nomor sebagai jawaban anda)</p>\r\n',0,1,0),
 (60,10,'Anggaplah dua pernyataan pertama adalah benar. Apakah pernyataan terakhir: \"John seusia dengan Sally. Sally lebih muda dari Bill. John lebih muda dari Bill\"',1,0,0),
 (61,10,'Seorang dealer membeli beberapa barrel seharga 4.000 rupiah. Ia menjual dengan harga 5.000 rupiah, mendapat untung\r\n50 rupiah setiap barrel. Berapa banyak barel yang dijual?',0,1,0),
 (62,10,'Misalkan Anda menyusun kata-kata berikut sehingga menjadi  kalimat lengkap. Jika kalimat itu benar, tulislah (B).\r\nJika salah, tulislah (S).  \"telur menghasilkan semua ayam\"',0,1,0),
 (63,10,'Cari arti yang sama.',1,0,0),
 (64,10,'<p>Sebuah jam terlambat 1 menit 18 detik dalam 39 hari. Berapa detik ia terlambat dalam sehari? (jawab dalam bentuk desimal)</p>\r\n',0,1,0),
 (65,10,'<p>CANVASS - CANVAS. Apakah kata-kata ini :</p>\r\n\r\n<p>1. memiliki arti yang sama</p>\r\n\r\n<p>2. memiliki arti yang berlawanan</p>\r\n\r\n<p>3. tidak memiliki arti sama atau berlawanan?</p>\r\n\r\n<p>(Pilih nomor sebagai jawaban anda)</p>\r\n',0,1,0),
 (66,10,'Anggaplah dua pernyataan pertama adalah benar. Pernyataan terakhir: \"Semua siswa mengikuti ujian. Beberapa orang diruangan ini adalah siswa. Beberapa orang diruangan ini \r\nmengikuti ujian.\"',1,0,0),
 (67,10,'<p>Dalam 30 hari seorang menabung 1 dolar. Berapa rata-rata tabungannya setiap hari? (jawab dalam bentuk desimal misal 20, 40, atau 0.085)</p>\r\n',0,1,0),
 (68,10,'<p>INGENIOUS - INGENUOUS. Apakah kata-kata ini :</p>\r\n\r\n<p>1. memiliki arti sama</p>\r\n\r\n<p>2. memiliki arti berlawanan</p>\r\n\r\n<p>3. tidak memiliki arti sama atau berlawanan?</p>\r\n',0,1,0),
 (69,10,'<p>Dua orang menangkap 36 ikan. X menangkap 5 kali lebih banyak dari Y. Berapa ikan yang ditangkap Y? (jawab dalam bentuk desimal)</p>\r\n',0,1,0),
 (70,10,'<p>Sebuah kotak segi empat, yang terisi penuh, memuat 800 kubik kaki gandum. Jika satu kotak lebarnya 8 kaki dan panjangnya 10 kaki, berapa kedalaman kotak itu? (Jawab dalam bentuk desimal)</p>\r\n',0,1,0),
 (71,10,'<p>Satu angka dari rangkaian berikut tidak cocok dengan pola angka yang lainnya. Angka berapakah itu?</p>\r\n\r\n<p>1. 1/2</p>\r\n\r\n<p>2. 1/4</p>\r\n\r\n<p>3. 1/6</p>\r\n\r\n<p>4. 1/8</p>\r\n\r\n<p>5. 1/9</p>\r\n\r\n<p>6.1/12</p>\r\n\r\n<p>(Pilih nomor sebagai jawab anda)</p>\r\n',0,1,0),
 (72,10,'<p>Jawablah pertanyaan ini dengan menulis &quot;Ya&quot; atau &quot;Tidak&quot;. Apakah P.M. berarti &lsquo;post merediem&rsquo;?</p>\r\n',0,1,0),
 (73,10,'<p>DAPAT DIPERCAYA - GAMPANG PERCAYA. Apakah kata-kata ini :</p>\r\n\r\n<p>1. memiliki arti sama</p>\r\n\r\n<p>2. memiliki arti berlawanan</p>\r\n\r\n<p>3. tidak memiliki arti sama atau berlawanan?</p>\r\n',0,1,0),
 (74,10,'Sebuah rok membutuhkan 2 ¼ meter  kain. Berapa banyak potong yang dihasilkan dari 45 meter kain? (dalam desimal)  ',0,1,0),
 (75,10,'Sebuah jam menunjuk tepat pada pukul 12 siang hari pada hari Senin. Pada pukul 2 siang,hari Rabu, jam itu terlambat\r\n26 detik. Pada rata-rata yang sama, berapa banyak jam itu terlambat dalam ½ jam? (dalam desimal)',0,1,0),
 (76,10,'Tim bisbol kami kalah 9 permainan dalam musim ini. Ini merupakan 3/8 bagian dari semua pertandingan mereka. Berapa banyak pertandingan yang mereka mainkan dalam musim kompetisi saat ini? (dalam desimal)',0,1,0),
 (77,10,'<p>Apakah angka selanjutnya dari seri ini?</p>\r\n\r\n<p>1, 0.5, 0.25, 0.125, ... ?</p>\r\n\r\n<p>(Jawab dalam bentuk desimal seperti 8, 120, 1.255)</p>\r\n',0,1,0),
 (78,10,'<p>Bentuk geometris ini dapat dibagi oleh suatu garis lurus menjadi dua bagian yang dapat disatukan dengan suatu&nbsp;<span style=\"line-height:1.6\">cara hingga membentuk bujur sangkar yang sempurna. Pilihlah angka sebagai jawaban.</span></p>\r\n\r\n<p><img alt=\"\" src=\"/TestOnline/upload/WPT/38.JPG\" style=\"height:134px; width:185px\" /></p>\r\n',1,0,0),
 (79,10,'<p>Apakah arti dari kalimat berikut: &quot;Sebuah sapu yang baru menyapu dengan bersih. Sepatu yang sudah lama sifatnya makin lunak.&quot;</p>\r\n\r\n<p>1. sama</p>\r\n\r\n<p>2. berlawanan</p>\r\n\r\n<p>3. tidak sama atau berlawanan?</p>\r\n',0,1,0),
 (80,10,'<p>Berapa duplikasi dari pasangan kata berikut ini?</p>\r\n\r\n<ul>\r\n	<li>Rexford, J.D. - Rockford, J.D</li>\r\n	<li>Singleton, M.O - Simbleten, M.O</li>\r\n	<li>Richards, W.E - Richad, W.E.</li>\r\n	<li>Siegel, A.B.- Seigel, A.B.</li>\r\n	<li>Wood, A.O. - Wood, A.O.</li>\r\n</ul>\r\n',0,1,0),
 (81,10,'<p>Gambar geometris ini dapat dibagi dengan garis lurus menjadi dua bagian yang dapat disatukan untuk membentuk&nbsp;<span style=\"line-height:1.6\">sebuah bujur sangkar yang sempurna. Gambarlah suatu garis dengan menghubungkan dua angka. Pilihlah angka yang mewakili jawaban.</span></p>\r\n\r\n<p><img alt=\"\" src=\"/TestOnline/upload/WPT/42.JPG\" style=\"height:125px; width:178px\" /></p>\r\n',1,0,0),
 (82,10,'<p>Dalam kelompok angka berikut ini, manakah angka yang terkecil?</p>\r\n\r\n<p>1. 10</p>\r\n\r\n<p>2. 1</p>\r\n\r\n<p>3. 0.999</p>\r\n\r\n<p>4. 0.33</p>\r\n\r\n<p>5. 11</p>\r\n',0,1,0),
 (83,10,'<p>Apakah makna dari kalimat berikut: &quot;Tidak ada orang jujur meminta maaf atas kejujurannya. Kejujuran dihormati dan lapar pujian&quot;.</p>\r\n\r\n<p>1. sama</p>\r\n\r\n<p>2. berlawanan</p>\r\n\r\n<p>3. tidak sama atau berlawanan</p>\r\n',0,1,0),
 (84,10,'Dengan harga 1.80 dolar, seorang grosir membeli satu kardus buah yang berisi 12 lusin. Ia tahu dua lusin akan \r\nbusuk sebelum dia menjualnya. Dengan harga berapa per lusin dia harus menjual jeruk itu untuk mendapat 1/3 \r\nhari harga seluruhnya\r\n',0,1,0),
 (85,10,'<p>Dalam rangkaian kata berikut ini, manakah kata yang berbeda dari yang lainnya?</p>\r\n\r\n<p>1. koloni</p>\r\n\r\n<p>2. perkawanan</p>\r\n\r\n<p>3. kawanan</p>\r\n\r\n<p>4. kru</p>\r\n\r\n<p>5. konstelasi</p>\r\n',0,1,0),
 (86,10,'<p>Anggaplah dua pernyataan pertama ini benar. Apakah pertanyaan terakhir: &quot;Orang besar dibodohi. Saya dibodohi. Saya adalah orang besar&quot;.</p>\r\n\r\n<p>1. benar</p>\r\n\r\n<p>2. salah</p>\r\n\r\n<p>3. tidak tahu</p>\r\n',0,1,0),
 (87,10,'<p>Tiga orang membentuk kemitraan dan setuju membagi keuntungan secara rata. X menginvestasi 4500 dolar. Y sebesar 3500 dolar dan Z sebesar 2000 dolar. Jika keuntungan mencapai 1500 dolar, lebih kurang berapa yang akan diperoleh X dibanding jika keuntungan dibagi berdasarkan besarnya investasi?</p>\r\n',0,1,0),
 (88,10,'<p>Empat dari 5 bagian ini dapat gabungkan untuk membuat segi tiga. Manakah keempat gambar ini?</p>\r\n',1,0,0),
 (89,10,'Untuk mencetak sebuah artikel berisi 30.000 kata, sebuah percetakan memutuskan untuk memakai dua ukuran jenis.\r\nDengan menggunakan tipe yang lebih besar, sebuah halaman tercetak akan memuat 1.200 kata. Dengan tipe yang lebih kecil, sebuah halaman memuat 1.500 kata. Artikel ini masuk dalam 22 halaman di majalah. Berapa banyak halaman yang dibutuhkan untuk tipe yang lebih kecil?',0,1,0),
